import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Add multiple items to cart rapidly
    const addToCartButtons = await page.$$('.add-to-cart:not([disabled])');
    for (let i = 0; i < Math.min(5, addToCartButtons.length); i++) {
      await addToCartButtons[i].click();
      await page.waitForTimeout(100); // Small delay between clicks
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_opened.png'));

    // Rapid quantity changes
    const quantityButtons = await page.$$('.quantity-btn');
    for (const button of quantityButtons) {
      for (let i = 0; i < 3; i++) {
        await button.click();
        await page.waitForTimeout(50);
      }
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantities_changed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantities_changed.png'));

    // Remove some items
    const removeButtons = await page.$$('.remove-item');
    for (let i = 0; i < Math.min(2, removeButtons.length); i++) {
      await removeButtons[i].click();
      await page.waitForTimeout(100);
    }

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_items_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_items_removed.png'));

    // Extract final cart data
    const cartTotal = await page.textContent('#cartTotal');
    const cartItems = await page.$$eval('.cart-item', items => items.length);

    // Close cart modal
    await page.keyboard.press('Escape');
    await page.waitForSelector('#cartModal', { state: 'hidden', timeout: 5000 });

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test with multiple add, quantity change, and remove operations",
      extractedData: {
        finalCartTotal: cartTotal,
        remainingItems: cartItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
